import { View, Text, SafeAreaView } from "react-native";
import React, { useLayoutEffect } from "react";
import { useNavigation } from "@react-navigation/native";

const HomeScreen = () => {
  const navigation = useNavigation();

  useLayoutEffect(() => {
    navigation.setOptions({
      headerShown: false,
    });
  }, []);

  return (
    <SafeAreaView className="flex flex-col items-center">
      <View className="bg-pink-200 flex w-screen md:container md:mx-auto items-center py-5">
        <Text className="container text-center">
          Lorem ipsum dolor sit amet consectetur adipisicing elit. Asperiores,
          doloremque! Facere voluptatibus officia temporibus architecto iure
          vitae earum dolore nostrum distinctio delectus necessitatibus sunt at
          animi perspiciatis ratione, dolorem sint voluptates. Delectus
          blanditiis possimus odio nisi error et quis amet animi debitis,
          assumenda quos eius incidunt obcaecati minus nam perspiciatis nostrum
          ut tenetur aliquid libero totam dolore officiis cumque doloremque?
          Obcaecati et recusandae architecto quia, ab quod ut sed ex numquam
          consequatur deleniti delectus vitae, molestias autem minus.
        </Text>
      </View>
    </SafeAreaView>
  );
};

export default HomeScreen;
